import { useEffect, useState } from "react";
import { getOrderById, getReadyOnlineOrders } from "../../api/orderApi";

function AllOrders() {
  /* ================= STATE ================= */
  const [allOrders, setAllOrders] = useState([]);
  const [onlineOrders, setOnlineOrders] = useState([]);
  const [dineInOrders, setDineInOrders] = useState([]);
  const [loading, setLoading] = useState(false);

  /* ================= LOAD ALL (ID LOOP) ================= */
  const loadAllOrders = async () => {
    setLoading(true);
    const results = [];
    let id = 1;

    while (true) {
      try {
        const order = await getOrderById(id);
        if (order) {
          results.push(order);
          id++;
        } else break;
      } catch {
        break; // 404 ‚Üí bitti
      }
    }

    setAllOrders(results);
    setDineInOrders(results.filter(o => o.tableNo != null));
    setLoading(false);
  };

  /* ================= LOAD READY ONLINE ================= */
  const loadOnlineOrders = async () => {
    const ready = await getReadyOnlineOrders();
    setOnlineOrders(ready);
  };

  useEffect(() => {
    loadAllOrders();
    loadOnlineOrders();
  }, []);

  /* ================= HELPERS ================= */
  const renderCourses = (o) => {
    const map = o.courses || o.orderCourses;
    if (!map || Object.keys(map).length === 0) return "-";

    return Object.entries(map).map(([c, q]) => (
      <div key={c}>{c} √ó {q}</div>
    ));
  };

  /* ================= UI ================= */
  return (
    <div style={{ maxWidth: 1300 }}>
      <h2>üìä Orders Dashboard</h2>

      {loading && <p>Loading...</p>}

      {/* ================= ALL ORDERS ================= */}
      <h3>üìã All Orders</h3>
      <table border="1" width="100%" cellPadding="8">
        <thead>
          <tr>
            <th>ID</th>
            <th>Type</th>
            <th>Status</th>
            <th>Total</th>
            <th>Date</th>
            <th>Time</th>
            <th>Deliverer</th>
          </tr>
        </thead>
        <tbody>
          {allOrders.map(o => (
            <tr key={o.orderId}>
              <td>{o.orderId}</td>
              <td>{o.tableNo != null ? "üçΩÔ∏è Dine-In" : "üöö Online"}</td>
              <td>{o.status}</td>
              <td>{o.orderPrice} ‚Ç∫</td>
              <td>{o.date}</td>
              <td>{o.time}</td>
              <td>{o.delivererId ?? "-"}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <br />

      {/* ================= ONLINE ORDERS ================= */}
      <h3>üöö Ready Online Orders</h3>
      <table border="1" width="100%" cellPadding="8">
        <thead>
          <tr>
            <th>ID</th>
            <th>Address</th>
            <th>Phone</th>
            <th>Status</th>
            <th>Total</th>
          </tr>
        </thead>
        <tbody>
          {onlineOrders.map(o => (
            <tr key={o.id}>
              <td>{o.id}</td>
              <td>{o.address}</td>
              <td>{o.phone}</td>
              <td>{o.status}</td>
              <td>{o.orderPrice} ‚Ç∫</td>
            </tr>
          ))}
        </tbody>
      </table>

      <br />

      {/* ================= DINE-IN ORDERS ================= */}
      <h3>üçΩÔ∏è Dine-In Orders</h3>
      <table border="1" width="100%" cellPadding="8">
        <thead>
          <tr>
            <th>ID</th>
            <th>Table</th>
            <th>Status</th>
            <th>Total</th>
            <th>Courses</th>
            <th>Waiter</th>
          </tr>
        </thead>
        <tbody>
          {dineInOrders.map(o => (
            <tr key={o.orderId}>
              <td>{o.orderId}</td>
              <td>{o.tableNo}</td>
              <td>{o.status}</td>
              <td>{o.orderPrice} ‚Ç∫</td>
              <td>{renderCourses(o)}</td>
              <td>{o.delivererId ?? "-"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default AllOrders;
